import axios from "axios";
import routesApi from "../../shared/routes/routesApi.routes";
import { ILogin } from "../models/ILogin";

export const postLogin = (form: ILogin) => {
  const resp = axios.post(routesApi.login, form);
  console.log(resp);
};
